#include <stdio.h>
#include "pico/stdlib.h"

// yama_2_GFXを使うため、インクルード
#include "yama_2_GFX.h"
// ADCを使うため、インクルード
#include "hardware/adc.h"

#define MOSI 19
#define SCK  18
#define CS   17
#define MISO 16

#define RST  22
#define DC   20

#define SPI_PORT  spi0


yama_2_GFX_ILI9341 tft = yama_2_GFX_ILI9341(SPI_PORT, DC, RST, CS);



// print_GFX_GFXcanvas16のインクルード
#include "print_GFX_GFXcanvas16.h"
// fontデータのインクルード
#include "glcdfont_tt24.h"

print_GFX_GFXcanvas16 canvas01 = print_GFX_GFXcanvas16(ILI9341_TFTWIDTH, ILI9341_TFTHEIGHT);
    // print_GFX_GFXcanvas16はメモリ上の確保したフレームバッファ上に描画するクラスです。
    // print_GFX_GFXcanvas16でメモリ上に書き込んだうえで
    // print_GFX_ILI9341もしくはyama_2_GFX_ILI9341のdrawRGBBitmap()で
    // 実際にILI9341のLCDにフレームバッファのメモリの内容を
    // 一度に書き込むことで高速に描画ができます。
    // print_GFX_GFXcanvas16を使う場合はCMakeLists.txtのadd_executableに
    // print_GFX_GFXcanvas16.cppを追加するのを忘れないようにしてください

// fontの宣言
glcdfont_tt24 glcdfont_tt24_01 = glcdfont_tt24();

const int picture01_width  = 320;
const int picture01_height = 240; 
extern const uint8_t picture01[];


void loop();
int main() {
    stdio_init_all();

    // ILI9341用にSPIを初期化
    spi_init(SPI_PORT, 10000000);
    gpio_set_function(MISO, GPIO_FUNC_SPI);
    gpio_set_function(SCK, GPIO_FUNC_SPI);
    gpio_set_function(MOSI, GPIO_FUNC_SPI);
    gpio_pull_up(MISO);
    gpio_pull_up(SCK);
    gpio_pull_up(MOSI);
    spi_set_format(SPI_PORT, 8, SPI_CPOL_0, SPI_CPHA_0, SPI_MSB_FIRST);   // SPI MODE0, MSBFIRST


    // Raspberry Pi PicoのADCと内蔵温度センサーの初期化
    adc_init();
    adc_set_temp_sensor_enabled(true);
    adc_select_input(4);


    // ILI9341の初期化と設定
    tft.tft_setup();
    tft.setRotation(0);
    tft.fillScreen(ILI9341_BLACK);


    // フレームバッファの設定
    canvas01.setRotation(3);
    canvas01.set_font(&glcdfont_tt24_01);
    canvas01.set_font_color(ILI9341_WHITE, ILI9341_BLACK);
    canvas01.set_font_pos(0,  0);


    while (1) {
        loop();
    }

    return 0;
}

void loop() {

    // 温度を取得
    double    conversion_factor = 3.3 / (4095.0);
    uint16_t  result = adc_read();
    double    reading = result * conversion_factor;
    double    temperature = 27 - (reading - 0.706) / 0.001721;

    canvas01.fillScreen(ILI9341_BLACK);
    // フレームバッファに背景の画像を表示
    canvas01.drawBitmap(0, 0, picture01, picture01_width, picture01_height, ILI9341_PURPLE);

    // フレームバッファに温度を表示
    canvas01.set_font_pos(0, 20);
    canvas01.printf("Temperature : %.2f degC\n", temperature);

    // フレームバッファのメモリの内容を実際にILI9341のLCDに書き込む
    tft.drawRGBBitmap(0, 0, canvas01.getBuffer(), tft.width(), tft.height());

    sleep_ms(1000);
}


